import React from 'react'
import logo from '../images/logo192.png'
import '../styles/Profile.css';

class Tweet extends React.Component{

    render(){
        return(
            <div className="container">
                <div className="row">
                    <div className="col-4">
                         <img src={logo} width="70px" height="90px"></img>
                    </div>
                    <div className='col-6'>
                        <p className ="Profile_user-mod">{this.props.username} <small>@{this.props.slug}</small></p><br/>
                        <p className ="Profile_user-mod">{this.props.text}</p>
                    </div>
                </div>
                <div className="row">
                    <h6>Expand</h6>
                    <p>Replay Retweet Favorite More</p>
                </div>

            </div>
        )
    }

}

export default Tweet;
